import PropTypes from "prop-types";
import { useEffect, useState } from "react";
import styles from "./03_information.module.css";

const Informations = ({ className = "" }) => {
  const [infoList, setInfoList] = useState([]);

  useEffect(() => {
    fetch("/assets/update.css")
      .then((response) => response.text())
      .then((data) => {
        const infoArray = data.split(",").filter((line) => line.trim() !== "");
        setInfoList(infoArray);
        console.log("infoArray:", infoArray);
      });
  }, []);

  return (
    <div className={[styles.rectangleParent, className].join(" ")}>
      <div className={styles.frameChild} />
      {/* <img
        className={styles.frameItem}
        loading="lazy"
        alt=""
        src="/vector-1.svg"
      />
      <img
        className={styles.frameInner}
        loading="lazy"
        alt=""
        src="/vector-1.svg"
      />
      <img
        className={styles.vectorIcon}
        loading="lazy"
        alt=""
        src="/vector-1.svg"
      />
      <img
        className={styles.frameChild1}
        loading="lazy"
        alt=""
        src="/vector-1.svg"
      /> */}
      <h3 className={styles.information}>information</h3>
      {infoList.map((info, index) => (
        <div key={index} className={styles.listItem}>
          {info}
        </div>
      ))}
      {/* <img
        className={styles.image1Icon}
        loading="lazy"
        alt=""
        src="/image-1@2x.png"
      /> */}
    </div>
  );
};

Informations.propTypes = {
  className: PropTypes.string,
};

export default Informations;
